import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "../../public/images/library"

function MiddleTop() {
  return (
    <div>
      <div class="row">
        <div class="col-lg-6 container">
          <h1 class="big-heading">Meet new and interesting dogs nearby.</h1>
          <button type="button" class="btn btn-dark btn-lg download-button"><i class="fab fa-apple"></i>
            Download</button>
          <button type="button" class="btn btn-lg btn-outline-light download-button"><i class="fab fa-google-play"></i>
            Download</button>
        </div>
        <div class="col-lg-6" id="rotate">
          {/* <img src="images/iphone6.png" class="tittle-image" alt="iphone-mockup"> */}
        </div>
      </div>
    </div>
  );
}

export default MiddleTop;
